DATA = {k: DATA[k] for k in sorted(DATA.keys(), reverse=True)}

def find_closest_values(y_val):
    lower = None
    higher = None
    for x, y in DATA.items():
        if y < y_val:
            lower = (x, y)
        elif y > y_val and higher is None:
            higher = (x, y)
            break

    return lower, higher

def interpolate(y_val, lower, higher):
    if lower is None or higher is None:
        return None
    x1, y1 = lower
    x2, y2 = higher
    return x1 + (x2 - x1) * ((y_val - y1) / (y2 - y1))

def emperical_std(average: float) -> float:
    lower, higher = find_closest_values(average)
    return 0 if average >= 167 else interpolate(average, lower, higher)